import React from 'react';

const SearchBox = ({ search, searchChange }) => {
    return (
        <input
            type="text"
            placeholder="Search recipes..."
            value={search}
            onChange={searchChange}
            className="search-bar"
        />
    );
};

export default SearchBox;
